The United Federation of Teachers President Michael Mulgrew said Wednesday he sees no way that America’s largest school district will be ready to reopen as scheduled in 22 days. Reopening NYC school buildings without safety precautions, he said, could be "one of the biggest debacles in the history of the city." 

The union hosted a live-streamed press conference Wednesday to announce a new school reopening safety checklist and called for antibody and COVID-19 testing for staff and students. Mulgrew warned that if the city tries to impose in-person learning at any school deemed unsafe by the UFT, the union may move forward with suing the city or authorizing its members to strike. 

